//register.fca.org.uk/ShPo_FirmDetailsPage?id=001b000001EjC6SAAV" target="_blank" rel="noopener noreferrer">900507</a>, for the issuing of electronic money.',"footer.regulation.us":'Wise is a Money Service Business registered with FinCen. It is authorized to operate in <a class="footer-link" href="https://wise.com/us/legal/state-licenses" target="_blank">most states</a>. In other states, the program is sponsored by Community Federal Savings Bank, to which were a service provider.',"footer.regulation.ca":'Wise Payments Canada Inc is registered as a money service business with the Financial Transactions and Reports Analysis Centre of Canada (FINTRAC) under registration number M15193392 and is licensed in Qu\xe9bec by the Autorit\xe9 des march\xe9s financiers (AMF) with license number <a class="footer-link" href="https://wise.com/canada/amf-license" target="_blank">902804</a>',"footer.regulation.sg":'Wise is the trading name of Wise Asia-Pacific Pte Ltd, which is a company incorporated under the laws of Singapore with Unique Entity Number 201422384R. Wise Asia-Pacific Pte Ltd is regulated as a Major Payment Institution by The Monetary Authority of Singapore (MAS) license: PS20200413. You can verify this information at the MAS website <a target="_blank" href="https://eservices.mas.gov.sg/fid/institution/detail/200786-TRANSFERWISE-SINGAPORE-PTE-LTD" rel="noopener noreferrer">here</a>. Consumers are advised to read this Customer Agreement carefully.<br><br>Customer support is available 24/7.',"footer.regulation.jp":'Wise Payments Limited is a registered money service business. In Japan the service is provided by Wise Payments Japan K.K., licensed by <a class="footer-link" href="https://www.s-kessai.jp/" target="_blank" rel="noopener noreferrer">Japan Payment Service Association</a> <a class="footer-link" href="https://lfb.mof.go.jp/kantou/" target="_blank" rel="noopener noreferrer">Kanto Finance Legal Bureau</a> as Type 2 Fund Transfer Service Provider with license number 00040.',"footer.regulation.hk":"Wise Payments Limited is licensed in Hong Kong as a Money Service Operator by the Customs and Excise Department, licence number: 15-01-01584.","footer.regulation.au":"The services are provided by Wise Australia Pty Ltd ACN 616 463 855. Wise Australia Pty Ltd holds an Australian Financial Services licence (AFSL) number 513764 and is a Purchased Payment Facility (PPF) provider authorised by the Australian Prudential Regulation Authority (APRA).","footer.regulation.ae":"Wise is authorised by the Financial Conduct Authority under the Electronic Money Regulations 2011, Firm Reference 900507, for the issuing of electronic money.  All investment services are provided by the respective Wise Assets entity in your location.","footer.regulation.my":'Wise Payments Malaysia Sdn. Bhd. (formerly known as TransferWise Malaysia Sdn. Bhd.) is a company incorporated under the laws of Malaysia with company registration number 201701025297. Wise Payments Malaysia Sdn. Bhd. is regulated under the laws of Malaysia as a remittance, money-changing and e-money issuance business. You can verify our licenses/approvals for remittance and money changing <a target="_blank" href="https://www.bnm.gov.my/documents/20124/1326831/1c_total_licensees_by_type_of_business_moneychanging_and_remittance.pdf">here</a> and for e-money issuance <a target="_blank" href="https://www.bnm.gov.my/list-of-regulatees">here</a>. Consumer advisory: Customer Due Diligence is a requirement under the Anti-Money Laundering, Anti-Terrorism Financing and Proceeds of Unlawful Activities Act 2001 and Money Services Business Act 2011.',"footer.regulation.eea":"Wise Europe SA is a company incorporated in Belgium with registered number 0713629988. Our registered office is at Rue du Tr\xf4ne 100, 3rd floor, 1050 Brussels, Belgium. Wise is a Payment Institution authorised by the National Bank of Belgium.","footer.regulation.br":"TransferWise Brasil Corretora de C\xe2mbio Ltda. (CNPJ/ME n. 36.588.217/